export const SidebarData = [
    {
        title: ' Edit',
        path: '/edit',
        icon: <VscEdit/>,
        cName: 'nav-text'
    },
    {
        title: ' Logout',
        path: '/',
        icon: <RiLogoutBoxLine/>,
        cName: 'nav-text'
    }
]
